    x, y = random.choice([(i, j) for i in range(4) for j in range(4) if board[i][j] == 0])
    board[x][y] = random.choice([2, 4])

def compress(board):
    new_board = [[0] * 4 for _ in range(4)]
    for i in range(4):
        pos = 0
        for j in range(4):
            if board[i][j] != 0:
                new_board[i][pos] = board[i][j]
                pos += 1
    return new_board

def merge(board):
    for i in range(4):
        for j in range(3):
            if board[i][j] == board[i][j + 1] and board[i][j] != 0:
                board[i][j] *= 2
                board[i][j + 1] = 0
    return board

def reverse(board):
    return [row[::-1] for row in board]

def transpose(board):
    return [[board[j][i] for j in range(4)] for i in range(4)]

def move_left(board):
    board = compress(board)
    board = merge(board)
    return compress(board)

def move_right(board):
    return reverse(move_left(reverse(board)))

def move_up(board):
    return transpose(move_left(transpose(board)))

